import React from "react";

//component for our review boxes, so we can make our reviews look organized
const ReviewBox = ({ author, rating, content }) => {
  return (
    <div style={styles.reviewBox}>
      <div style={styles.header}>
        <h3>{author}</h3>
      </div>
      <div style={styles.rating}>
        <p>Rating: {rating}</p>
      </div>
      <div style={styles.content}>
        <p>{content}</p>
      </div>
    </div>
  );
};

// put this wherever u have ur styling stuff
const styles = {
  reviewBox: {
    border: "1px solid #ccc",
    borderRadius: "8px",
    padding: "16px",
    marginBottom: "16px",
    boxShadow: "0 0 5px rgba(0, 0, 0, 0.1)",
  },
  header: {
    marginBottom: "8px",
  },
  rating: {
    marginBottom: "8px",
  },
  content: {
    color: "#555",
  },
};

export default ReviewBox;
